const jsonData="../data/share-of-individuals-using-the-internet.json";var json,app=new Vue({el:"#app",data:{datas:[]},methods:{key:function(item){return item.country+"-"+item.year},roundFloat:float=>(val=parseFloat(float),val.toFixed(1))},computed:{highestYear(){if(0!=this.datas.length)return this.datas.reduce((a,b)=>Number(a.year)>Number(b.year)?a.year:b.year)},lowestYear(){if(0!=this.datas.length)return this.datas.reduce((a,b)=>{a&&b&&(Number(a.year)>Number(b.year)?a.year:b.year)})},uniqueCountry(){return this.datas.reduce((seed,current)=>Object.assign(seed,{[current.country]:current}),{})}},mounted:function(){axios.get(jsonData).then((function(response){app.datas=response.data}))}});